import React from 'react';
import { motion } from 'framer-motion';

const ContactPanel = () => {
  const socialLinks = [
    { icon: "fab fa-github", url: "https://github.com/nainasachdev10", label: "GitHub" },
    { icon: "fab fa-linkedin", url: "https://www.linkedin.com/in/naina-sachdev/", label: "LinkedIn" },
    { icon: "fab fa-twitter", url: "https://x.com/Nainasachdev11", label: "X (Twitter)" }
  ];

  return (
    <div className="w-full h-full overflow-y-auto px-4 py-6 flex items-center justify-center">
      <div className="w-full max-w-2xl text-center">
        <motion.h2
          className="text-3xl md:text-4xl font-bold mb-6"
          style={{
            background: 'linear-gradient(45deg, #FFB6C1, #E6E6FA)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            backgroundClip: 'text',
          }}
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          Get In Touch
        </motion.h2>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
        >
          <h3
            className="text-2xl font-bold mb-2"
            style={{ color: '#FFB6C1' }}
          >
            Let's work together!
          </h3>
          <p
            className="text-base mb-6"
            style={{ color: '#FDF6E3', opacity: 0.9 }}
          >
            I'm always interested in new opportunities and exciting projects.
            Feel free to reach out if you'd like to collaborate or just want to say hello.
          </p>

          {/* Contact Details */}
          <div className="flex flex-col gap-3 mb-6 max-w-md mx-auto">
            <a
              href="mailto:nainasachdev01@gmail.com"
              className="flex items-center gap-3 p-3 rounded-lg"
              style={{
                background: 'rgba(255, 255, 255, 0.05)',
                border: '1px solid rgba(255, 182, 193, 0.2)',
                textDecoration: 'none',
              }}
              aria-label="Send email"
            >
              <motion.div
                whileHover={{
                  scale: 1.02,
                  backgroundColor: 'rgba(255, 182, 193, 0.1)',
                }}
                transition={{ duration: 0.2 }}
                className="flex items-center gap-3 w-full"
              >
                <i
                  className="fas fa-envelope"
                  style={{ color: '#FFD700', fontSize: '0.9rem' }}
                />
                <span style={{ color: '#FDF6E3', fontSize: '0.8rem' }}>
                  nainasachdev01@gmail.com
                </span>
              </motion.div>
            </a>
            <a
              href="https://t.me/nainasachdev"
              target="_blank"
              rel="noopener noreferrer"
              className="flex items-center gap-3 p-3 rounded-lg"
              style={{
                background: 'rgba(255, 255, 255, 0.05)',
                border: '1px solid rgba(255, 182, 193, 0.2)',
                textDecoration: 'none',
              }}
              aria-label="Open Telegram chat"
            >
              <motion.div
                whileHover={{
                  scale: 1.02,
                  backgroundColor: 'rgba(255, 182, 193, 0.1)',
                }}
                transition={{ duration: 0.2 }}
                className="flex items-center gap-3 w-full"
              >
                <i
                  className="fab fa-telegram-plane"
                  style={{ color: '#FFD700', fontSize: '0.9rem' }}
                />
                <span style={{ color: '#FDF6E3', fontSize: '0.8rem' }}>
                  @nainasachdev
                </span>
              </motion.div>
            </a>
            <div
              className="flex items-center gap-3 p-3 rounded-lg"
              style={{
                background: 'rgba(255, 255, 255, 0.05)',
                border: '1px solid rgba(255, 182, 193, 0.2)',
              }}
            >
              <motion.div
                whileHover={{
                  scale: 1.02,
                  backgroundColor: 'rgba(255, 182, 193, 0.1)',
                }}
                transition={{ duration: 0.2 }}
                className="flex items-center gap-3 w-full"
              >
                <i
                  className="fas fa-map-marker-alt"
                  style={{ color: '#FFD700', fontSize: '0.9rem' }}
                />
                <span style={{ color: '#FDF6E3', fontSize: '0.8rem' }}>
                  Mumbai, India
                </span>
              </motion.div>
            </div>
          </div>

          {/* Social Links */}
          <div className="flex justify-center gap-4">
            {socialLinks.map((social, index) => (
              <motion.a
                key={index}
                href={social.url}
                target="_blank"
                rel="noopener noreferrer"
                className="w-14 h-14 rounded-full flex items-center justify-center"
                style={{
                  background: 'linear-gradient(45deg, #FFB6C1, #E6E6FA)',
                  color: '#1a1a2e',
                  textDecoration: 'none',
                  fontSize: '1.5rem',
                }}
                aria-label={social.label}
                whileHover={{
                  scale: 1.1,
                  rotate: 5,
                  boxShadow: '0 10px 25px rgba(255, 182, 193, 0.4)',
                }}
                whileTap={{ scale: 0.95 }}
                transition={{ duration: 0.2 }}
              >
                <i className={social.icon} />
              </motion.a>
            ))}
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default ContactPanel;
